   "source": [
    "# draw a plot with \"Review_Date\" as the x axis and \"Rating\" as the y axis,\n",
    "#add a point for each data point & move each point slightly so they don't overlap\n",
    "ggplot(chocolateData, aes(x= Review_Date, y = Rating)) + geom_point() + geom_jitter()"
   ]
  },
