   "source": [
    "Interesting. ```cut``` did seem to split ```Cocoa_Percent``` into 5 colours (rather than just a monochrome range as without it), and these colours actually help understand what is going on with the ratings. \n",
    "\n",
    "It looks like chocolate bars with very high cocoa percents tend to get lower ratings. Let's see if that's the case by drawing a helpful graph. At this point, you know enough to make this graph yourself. Show me what you got! :)\n",
    "- true, but it also seems the 65.2-76.8 Cocoa Percent range yields the highest ratings, though that could just be because of how most of the chocolate bars fall in that range."
   ]
