   "source": [
    "# Your turn!\n",
    "# Plot the relationship between cocoa percentage and ratings,\n",
    "#using whichever geom (or multiple geoms) you like.\n",
    "# Note that, if you use geom_smooth(), a linear model may not be the best fit \n",
    "#for the data!\n",
    "\n",
    "ggplot(chocolateData, aes(x= Cocoa_Percent, y = Rating)) + \n",
    "    geom_point() + # add a point for each data point\n",
    "    geom_jitter() + # move points slightly so they don't overlap\n",
    "    # what if it's a -get this- normal distribution? (Im bsing so hard)\n",
    "    geom_smooth(method = stats::loess)"
   ]
  },
